import React, { Component, Fragment } from 'react';
import { AppWrapper } from './App.styled.js'
import HeaderSection from './components/headerSection/HeaderSection.js';

class App extends Component {
  constructor(props){
    super(props);

  }

  componentWillMount() {
    const options = {
      headers: { 'Content-Type': 'application.json' },
      method: 'POST',
      body: Json.stringify(
        { query:
          "query { mostRecentSnapshot { broker { name } } }"
        }
      )
    };

    fetch('https://hw-fe-challenge-api.herokuapp.com/graphql', options)
    .then(resp => resp.json())
    .then((resp) => {
      console.log("I worked!!!")
    })
    .catch((e) => {
      console.error("error fetching data");
      console.log('The error is: ', e)
    })
  }

  render() {
    return (
      <Fragment>
        Welcome to Highwing!
        <HeaderSection />
      </Fragment>
    );
  }
}

export default App;
